    false,nt"url": null,nt"notes": "This annual narrative report for Potomac
    River National Wildlife Refuge Complex outlines Refuge accomplishments during the
    2009 fiscal year. The report begins with a summary of the year's highlights and
    weather conditions. The report includes a planning section which discusses the master
    plan. Refuge administration is outlined; information about personnel, youth programs,
    manpower programs, volunteer programs, funding, safety, and technical assistance
    is given. Habitat management is also covered; subjects include wetlands, forests,
    grasslands, fire management, and pest control. The wildlife section of the report
    discusses wildlife diversity, endangered and threatened species, waterfowl, marsh
    birds and waterbirds, game mammals, marking and bird banding, and disease control.
    The public uses of the Refuge described in this report include outdoor classrooms,
    interpretive programs, hunting, wildlife observation, outdoor recreation, and law
    enforcement. The equipment and facilities section of the report provides information
    about major maintenance, equipment replacement, computer systems, and energy conservation.
    Items of interest are provided at the end.",nt"owner_org": "4d7ad1cd-3641-420b-8116-e4082f49cd44",nt"extras":
